import React, { useState } from "react";
import { auth } from "./firebase";
import "./SignIn.css"
import googleIcon from "./googleIcon.svg"
import { Link } from "react-router-dom";
import { createUserWithEmailAndPassword } from "firebase/auth";

const SignIn = () => {

    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('')

    const signIn = (event) => {
        event.preventDefault()
        createUserWithEmailAndPassword(auth, email, password)
        .then((userCredential) => {
            console.log(userCredential);
        }).catch((error) => {
            alert(error);
        })
    }

    return <>
        <div className="signup__body">
            <div data-aos="fade-up" data-aos-delay="100" className="signup__outerBox">

                <div className="signup__">CodeBlogs</div>
                <div className="signup__heading">Create an account</div>
                <div className="signup__box">
                <form className="signup__form" onSubmit={signIn}>
                    <input type="text" value={email} onChange={(e)=> setEmail(e.target.value)} placeholder="Enter your Email" className="signup__email __input"/>
                    <input type="text" value={password} onChange={(e)=> setPassword(e.target.value)} placeholder="Enter your Name" className="signup__name __input"/>
                    <input type="password" placeholder="Enter Password" className="signup__password __input"/>
                    <button className="signup__btn btn_signup" type="submit">Signup</button>
                </form>
                OR
                <button className="signup__btn btn_google"><img src={googleIcon} alt='google'/> &nbsp; Sign-up with Google</button>
                By continuing, you agree to our terms and policies.
            </div>
            </div>
        </div>
    </>
}

export default SignIn;
